INSERT INTO assistance(entity_id, user_id, assistance_status_id)
SELECT e.id, u.id, [as].id
FROM entity e,
     [user] u,
     assistance_status [as]
WHERE e.name = 'Policia'
  AND u.cuil = '20400285145'
  AND [as].name = 'in_progress';

INSERT INTO message(assistance_id, message_type_id, payload, attachment, is_from_user)
SELECT TOP 1 a.id, mt.id, '{"lat":-31.9106875,"lng":-63.6840853,"message":"Hola, que tal"}', '', 1
FROM message_type mt,
     assistance a
         JOIN [user] u
              ON a.user_id = u.id
WHERE u.cuil = '20400285145'
  AND mt.name = 'creation'
ORDER BY a.timestamp DESC;

