INSERT INTO announcement(author, title, content)
VALUES ('Javier Roberts',
        N'Policía de la provincia de Córdoba anunció nuevas medidas que afectarán a los ciudadanos',
        N'<p class="article-date">23 de mayo 2022, 10:44hs</p><div class="announcement-header"><p class="article-title">Policía de la provincia de Córdoba anunció nuevas medidas que afectarán a los ciudadanos</p></div><div class="announcement-body"><p class="article-subtitle">Las medidas han sido anunciadas este lunes a primera hora</p><div class="image">' +
         '<img alt="" src="data:image/jpeg;base64,"/>' +
        N'</div><p class="image-subtitle">El jefe de policía de la ciudad junto con sus segundos a cargo anunciando las nuevas medidas</p><p class="paragraph">El jefe de policía de la provincia anunció este lunes a primera hora nuevas medidas restrictivas afectando así a toda la población cordobesa.</p><p class="paragraph">Las nuevas medidas restrictivas se deben a un nuevo rebrote de Covid-19 que está tomando cada vez mas fuerza en la provincia de Córdoba.</p><p class="paragraph">Esta decisión unilateral ha sido muy difícil de tomar pero desde el gobierno queremos asegurarnos que los ciudadanos puedan estar a salvo de la nueva ola de Covid-19 vigente.</p><h2 class="paragraph">La decisión parece haber molestado a muchos espectadores que estaban allí durante el anuncio.</h2>
<p class="paragraph">Las nuevas medidas entrarán en vigencia a partir de mañana martes, con laidea de que así bajasen los contagios previniendo nuevamente una expansión del covid.</p><p class="paragraph">Las mismas impondrán toque de queda desde las 19hs y estricto y obligatorio uso del barbijo</p><p class="paragraph">Noticia que está siendo actualizada.</p></div>'),
       ('Javier Roberts',
        N'Incendios en la provincia de Córdoba en aumento',
        N'<p class="article-date">17 de mayo 2022, 10:44hs</p><div class="announcement-header"><p class="article-title">Incendios en la provincia de Córdoba en aumento</p></div><div class="announcement-body"><p class="article-subtitle">Los incendios en la provincia de Córdoba están creciendo descontroladamente</p><div class="image">' +
        N'<img alt="" src="data:image/webp;base64,"/>' +
        N'</div><p class="image-subtitle">Incendios en las sierras cordobesas</p><p class="paragraph">Así lo informó el jefe del departamentod de bomberos de la ciudad</p><p class="paragraph">Ya llevan mas de 15000 hectáreas de sierras cordobesas quemadas en los ultimos 9 días</p><p class="paragraph">Desde que iniciaron los incendios el fuego no para de crecer. Los bomberos trabajan arduamente para combatirlo</p><h2 class="paragraph">Incalculables perdidas se han sufrido, no solo económicas y de vidas animales.</h2>')